import { useEffect, useState } from "react";
import "./style/App.css";

function App() {
  const [loading, setLoading] = useState(false); 
  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 3600);
  }, []);
  return (
    <div className="App">
      {
        loading 
      }
    </div>
  );
}

export default App;
